import React from 'react';
import './StatisticsSection.css';

const StatisticsSection = () => {
  return (
    <div className="statistics-container">
      <div className='statistics-items'> 
        <h2> Plateforme Best Food Friend et ses partenaires en 2023 ont faits: </h2>
      </div>
      <div className="statistics-item">
        <h3 className="statistics-number">8250</h3>
        <p className="statistics-label">Arbres plantés</p>
      </div>
      <div className="statistics-item">
        <h3 className="statistics-number">217</h3>
        <p className="statistics-label">Puits et forages</p>
      </div>
      <div className="statistics-item">
        <h3 className="statistics-number">72</h3>
        <p className="statistics-label">Mosquées</p>
      </div>
      <div className="statistics-item">
        <h3 className="statistics-number">2</h3>
        <p className="statistics-label">Écoles</p>
      </div>
    </div>
  );
};

export default StatisticsSection;
